<html>
    <head>
        <meta charset="UTF-8">
        <meta http-equiv="X-UA-Compatible" content="IE=edge">
        <meta name="viewport" content="width=device-width, initial-scale=1.0">
        <title>Black Hat Rider - Calculamatrise</title>
        <link rel="stylesheet" href="styles/default.css">
        <link rel="stylesheet" href="styles/dark.css" id="theme" onload="
        localStorage.getItem('theme') === 'midnight' && (this.href = 'styles/midnight.css') || localStorage.getItem('theme') !== 'dark' && (this.href = 'styles/light.css')
        ">
    </head>
    <body>
        <game-container>
            <game-interface>
                <game-overlay style="display: none;">
                    <nav onclick="event.target.tagName !== 'NAV' && ([...this.children].forEach(element => element.classList[event.target.dataset.id === element.dataset.id ? 'add' : 'remove']('active')),
                    this.parentElement.querySelectorAll('div').forEach(element => element.style.setProperty('display', 'none')),
                    this.parentElement.querySelector('div#' + event.target.dataset.id).style.setProperty('display',
                    this.parentElement.querySelector('div#' + event.target.dataset.id).style.display === 'flex' ? 'none' : 'flex'))">
                        <button class="active" data-id="track">Track</button>
                        <button data-id="ghost">Ghost</button>
                        <button data-id="settings">Settings</button>
                        <button data-id="theme">Theme</button>
                    </nav>
                    <div id="track" style="display: flex;">
                        <button onclick="game.reset()">Clear</button>
                        <button onclick="window.game.load(document.querySelector('textarea#code').value)">Load</button>
                        <button onclick="window.game.load()">Load File...</button>
                        <button onclick="document.querySelector('textarea#code').value = game.scene.toString()">Save</button>
                        <button onclick="window.game.saveAs()">Save As...</button>
                        <textarea id="code" cols="30" rows="10" onkeydown="event.stopPropagation()"></textarea>
                    </div>
                    <div id="ghost">
                        <button onclick="game.scene.players.splice(1, game.scene.players.length)">Clear Ghosts</button>
                        <button onclick="game.scene.watchGhost(document.querySelector('textarea#gcode').value), document.querySelector('game-overlay').style.setProperty('display', 'none')">Load</button>
                        <button onclick="
                        let picker = document.createElement('input');
                        picker.type = 'file';
                        picker.accept = 'text/plain';
                        picker.addEventListener('change', function(event) {
                            const reader = new FileReader();
                            reader.addEventListener('load', function() {
                                game.scene.watchGhost(this.result);
                            });
                            reader.readAsText(this.files[0]);
                        });
                        picker.click();
                        ">Load File...</button>
                        <button onclick="document.querySelector('textarea#gcode').value = game.scene.firstPlayer.records.map(record => [...record].join(' ')).join(',') + ',' + game.scene.firstPlayer.vehicle.name">Save</button>
                        <button onclick="
                        let link = document.createElement('a');
                        file = new Blob([
                            game.scene.firstPlayer.records.map(record => [...record].join(' ')).join(',')
                        ], {
                            type: 'text/plain'
                        });
                        link.href = window.URL.createObjectURL(file);
                        link.download = 'bhr_ghost_' + new Date(new Date().setHours(new Date().getHours() - new Date().getTimezoneOffset() / 60)).toISOString().split(/t/i).join('_').replace(/\..+/, '').replace(/:/g, '-');
                        link.click();
                        ">Save As...</button>
                        <textarea id="gcode" cols="30" rows="10" onkeydown="event.stopPropagation()"></textarea>
                    </div>
                    <div id="settings">
                        <label for="auto-pause">Auto pause&emsp;<input type="checkbox" id="auto-pause"></label>
                    </div>
                    <div id="theme">
                        <button onclick="localStorage.setItem('theme', 'light'), document.querySelector('link#theme').href = 'styles/light.css', window.game.scene.grid.sectors.forEach(sector => sector.rendered = false);">Light</button>
                        <button onclick="localStorage.setItem('theme', 'midnight'), document.querySelector('link#theme').href = 'styles/dark.css', window.game.scene.grid.sectors.forEach(sector => sector.rendered = false);">Midnight</button>
                        <button onclick="localStorage.setItem('theme', 'dark'), document.querySelector('link#theme').href = 'styles/dark.css', window.game.scene.grid.sectors.forEach(sector => sector.rendered = false);">Dark</button>
                    </div>
                </game-overlay>
                <toolbar>
                    <div class="left">
                        <tool title="Pause/Play - Space" onclick="this.firstElementChild.classList[(window.game.scene.paused = !window.game.scene.paused) ? 'remove' : 'add']('playing')">
                            <playpause class="playing"/>
                        </tool>
                        <tool title="Checkpoint - Enter" onclick="window.game.scene.gotoCheckpoint()">
                            <backtrack/>
                        </tool>
                        <tool title="Cancel Checkpoint - Backspace" style="border-bottom-width: 1px;border-bottom-style: solid; border-bottom-right-radius: 5px;" onclick="window.game.scene.removeCheckpoint()">
                            <rewind/>
                        </tool>
                        <br>
                        <tool title="Change Vehicle - Ctrl + B" style="border-bottom-width: 1px;border-bottom-style: solid;border-bottom-right-radius: 5px;border-top-width: 1px;border-top-style: solid;border-top-right-radius: 5px;" tabindex="0" onclick="window.game.scene.switchBike()">
                            <wheel>
                                <svg xmlns="http://www.w3.org/2000/svg" viewbox="0 0 25 25">
                                    <circle cx="12.5" cy="12.5" r="10"/>
                                    <line x1="12.5" y1="12.5" x2="20.5" y2="12.5"/>
                                    <line x1="12.5" y1="12.5" x2="19.42820323027551" y2="16.5"/>
                                    <line x1="12.5" y1="12.5" x2="16.5" y2="19.428203230275507"/>
                                    <line x1="12.5" y1="12.5" x2="12.5" y2="20.5"/>
                                    <line x1="12.5" y1="12.5" x2="8.500000000000002" y2="19.42820323027551"/>
                                    <line x1="12.5" y1="12.5" x2="5.57179676972449" y2="16.5"/>
                                    <line x1="12.5" y1="12.5" x2="4.5" y2="12.500000000000002"/>
                                    <line x1="12.5" y1="12.5" x2="5.571796769724491" y2="8.5"/>
                                    <line x1="12.5" y1="12.5" x2="8.499999999999996" y2="5.571796769724492"/>
                                    <line x1="12.5" y1="12.5" x2="12.499999999999998" y2="4.5"/>
                                    <line x1="12.5" y1="12.5" x2="16.5" y2="5.571796769724491"/>
                                    <line x1="12.5" y1="12.5" x2="19.428203230275507" y2="8.499999999999996"/>
                                </svg>
                            </wheel>
                        </tool>
                        <br>
                        <tool title="Fullscreen - F" style="border-bottom-width: 1px;border-bottom-style: solid;border-bottom-right-radius: 5px;border-top-width: 1px;border-top-style: solid;border-top-right-radius: 5px;" onclick="document.fullscreenElement ? document.exitFullscreen() : window.game.container.requestFullscreen()">
                            <fullscreen/>
                        </tool>
                        <settings>
                            <tool title="Increase length - A + Scroll" style="border-top-width: 1px;border-top-style: solid;border-top-right-radius: 5px;" onclick="
                            if (window.game.scene.toolHandler.selected === 'eraser') window.game.scene.toolHandler.currentTool.size < 500 && (window.game.scene.toolHandler.currentTool.size += 5); else window.game.scene.toolHandler.currentTool.length < 200 && (window.game.scene.toolHandler.currentTool.length += 8);
                            ">
                                <increment/>
                            </tool>
                            <tool title="Decrease length - A + Scroll" style="border-bottom-width: 1px;border-bottom-style: solid;border-bottom-right-radius: 5px;" onclick="
                            if (window.game.scene.toolHandler.selected === 'eraser') window.game.scene.toolHandler.currentTool.size > 10 && (window.game.scene.toolHandler.currentTool.size -= 5); else window.game.scene.toolHandler.currentTool.length > 4 && (window.game.scene.toolHandler.currentTool.length -= 8);
                            ">
                                <decrement/>
                            </tool>
                            <div data-id="eraser">
                                <tool title="Erase physical lines - Enabled" class="active" style="border-top-width: 1px;border-top-style: solid;border-top-right-radius: 5px;" onclick="
                                this.classList[!+window.game.scene.toolHandler.currentTool.ignoring[window.game.scene.toolHandler.currentTool.ignoring.has('physics') ? 'delete' : 'add']('physics') ? 'remove' : 'add']('active');
                                ">
                                    <brush/>
                                </tool>
                                <tool title="Erase visual lines - Enabled" class="active" onclick="
                                this.classList[!+window.game.scene.toolHandler.currentTool.ignoring[window.game.scene.toolHandler.currentTool.ignoring.has('scenery') ? 'delete' : 'add']('scenery') ? 'remove' : 'add']('active');
                                ">
                                    <brush class="scenery"/>
                                </tool>
                                <tool title="Erase powerups - Enabled" class="active" style="border-bottom-width: 1px;border-bottom-style: solid;border-bottom-right-radius: 5px;" onclick="
                                this.classList[!+window.game.scene.toolHandler.currentTool.ignoring[window.game.scene.toolHandler.currentTool.ignoring.has('powerups') ? 'delete' : 'add']('powerups') ? 'remove' : 'add']('active');
                                ">
                                    <powerup class="target"/>
                                </tool>
                            </div>
                        </settings>
                    </div>
                    <div class="right">
                        <tool title="Brush - A" onclick="window.game.scene.toolHandler.setTool('brush'), window.game.scene.toolHandler.currentTool.scenery = !1">
                            <brush/>
                        </tool>
                        <tool title="Scenery Brush - S" onclick="window.game.scene.toolHandler.setTool('brush'), window.game.scene.toolHandler.currentTool.scenery = !0">
                            <brush class="scenery"/>
                        </tool>
                        <tool title="Line - Q" onclick="window.game.scene.toolHandler.setTool('line'), window.game.scene.toolHandler.currentTool.scenery = !1">
                            <line>
                                <svg xmlns="http://www.w3.org/2000/svg" viewbox="0 0 25 25">
                                    <line x1="20" y1="5" x2="5" y2="20"/>
                                </svg>
                            </line>
                        </tool>
                        <tool title="Scenery Line - W" onclick="window.game.scene.toolHandler.setTool('line'), window.game.scene.toolHandler.currentTool.scenery = !0">
                            <line class="scenery">
                                <svg xmlns="http://www.w3.org/2000/svg" viewbox="0 0 25 25" style="stroke: #aaa">
                                    <line x1="20" y1="5" x2="5" y2="20"/>
                                </svg>
                            </line>
                        </tool>
                        <tool title="Eraser - E" onclick="window.game.scene.toolHandler.setTool('eraser')">
                            <eraser/>
                        </tool>
                        <tool title="Camera - R" onclick="window.game.scene.toolHandler.setTool('camera')">
                            <camera/>
                        </tool>
                        <tool title="Grid - G" style="border-bottom-width: 1px;border-bottom-style: solid;border-bottom-left-radius: 5px;" onclick="
                        this.classList[(window.game.scene.gridSize = 11 - window.game.scene.gridSize) > 1 ? 'add' : 'remove']('active');
                        ">
                            <line class="scenery">
                                <svg xmlns="http://www.w3.org/2000/svg" viewbox="0 0 25 25" style="stroke: #ccc; stroke-width: 1">
                                    <line x1="5" y1="5" x2="20" y2="5"/><line x1="5" y1="5" x2="5" y2="20"/>
                                    <line x1="5" y1="10" x2="20" y2="10"/><line x1="10" y1="5" x2="10" y2="20"/>
                                    <line x1="5" y1="15" x2="20" y2="15"/><line x1="15" y1="5" x2="15" y2="20"/>
                                    <line x1="5" y1="20" x2="20" y2="20"/><line x1="20" y1="5" x2="20" y2="20"/>
                                </svg>
                            </line>
                        </tool>
                        <br>
                        <tool title="Goal" style="border-top-width: 1px;border-top-style: solid;border-top-left-radius: 5px;" onclick="window.game.scene.toolHandler.setTool('goal')">
                            <powerup class="target"/>
                        </tool>
                        <tool title="Checkpoint" onclick="window.game.scene.toolHandler.setTool('checkpoint')">
                            <powerup class="checkpoint"/>
                        </tool>
                        <tool title="Booster" onclick="window.game.scene.toolHandler.setTool('boost')">
                            <powerup class="boost triangle">
                                <svg xmlns="http://www.w3.org/2000/svg" viewbox="0 0 25 25" style="stroke-width: 2">
                                    <polyline points="5,7 20,12.5 5,18 5,7"/>
                                </svg>
                            </powerup>
                        </tool>
                        <tool title="Gravity" onclick="window.game.scene.toolHandler.setTool('gravity')">
                            <powerup class="gravity triangle">
                                <svg xmlns="http://www.w3.org/2000/svg" viewbox="0 0 25 25" style="stroke-width: 2">
                                    <polyline points="5,7 20,12.5 5,18 5,7"/>
                                </svg>
                            </powerup>
                        </tool>
                        <tool title="Bomb" onclick="window.game.scene.toolHandler.setTool('bomb')">
                            <powerup class="bomb"/>
                        </tool>
                        <tool title="Slow-motion" onclick="window.game.scene.toolHandler.setTool('slow-mo')">
                            <powerup class="slowmo"/>
                        </tool>
                        <tool title="Anti-gravity" onclick="window.game.scene.toolHandler.setTool('antigravity')">
                            <powerup class="antigravity"/>
                        </tool>
                        <tool title="Teleporter" style="border-bottom-width: 1px;border-bottom-style: solid;border-bottom-left-radius: 5px;" onclick="window.game.scene.toolHandler.setTool('teleporter')">
                            <powerup class="teleport"/>
                        </tool>
                    </div>
                </toolbar>
            </game-interface>
            <canvas id="view" width="900" height="500"></canvas>
        </game-container>
        <script type="module" src="bootstrap.js"></script>
        <script type="module">
